description:
Storyline

When the archaeologist Sigurd can't settle on the myth about Ragnarok, the end of the world in Northern mythology, he decides to go on an expedition together with two colleges and his two kids. This adventure leads them to Finnmark in the Northern most part of Norway, and into &quot;No mans land&quot; between Russia and Norway, where no one has been in modern times. Old runes gets new meanings, when they unveil the truth. A truth bigger and more spectacular than you would have dreamed.


